\boxed{\lambda \in (3, 4]} 

Selgitus: Meile antud on funktsioon f:[0,1] → [0,1], kus f(x) = λx(1 − x) ning ülesande tingimuse kohaselt tuleb leida need λ väärtused (0 ≤ λ ≤ 4), mille korral leidub x ∈ [0,1] nii, et x pole fikseeritud punkt (ehkä f(x) ≠ x), kuid samas kehtib f(f(x)) = x, st x on perioodi 2 punkt.

Logistilise kaardi puhul on teada, et fikseeritud punkted on lahendused võrrandile f(x) = x. Nende hulka kuuluvad alati x = 0 ja (kui λ > 1) x = 1 − 1/λ. Ülesande nõue f(f(x)) = x sisaldab seega ka fikseeritud punkte, kuid ülesande tingimus eeldab, et otsitakse „mittefikseeritud” lahendusi, st perioodi 2 tsükleid, kus f(x) ≠ x.

Tuntud fakt on, et perioodi 2 lahendused ilmnevad logistilises kaardis periood-dubleerumise bifurkatsiooni kaudu täpselt siis, kui fikseeritud punkted kaotavad stabiilsuse, mis juhtub juba, kui λ = 3. Seega leiduvad mittefikseeritud lahendused võrrandile f(f(x)) = x (ehkä ka „tsükli 2 punkted”) täpselt siis, kui λ > 3. Kuna λ on antud vahemikus [0,4], on otsitavad väärtused λ ∈ (3,4].

Seega on vastus:

\boxed{\lambda \in (3, 4]}
